import { Layers, Code } from "lucide-react";


const SoftwareEngineering = () => {
  const topics = [
    { name: "SDLC Models", desc: "Waterfall, Agile, Scrum, and Kanban methodologies.", icon: <Layers className="w-10 h-10 text-orange-600"/>, path: "/placement-prep/core-subjects/se/sdlc", color: "from-orange-100 to-orange-50" },
    { name: "Design Principles", desc: "SOLID principles, UML diagrams, and best practices.", icon: <Code className="w-10 h-10 text-blue-600"/>, path: "/placement-prep/core-subjects/se/design", color: "from-blue-100 to-blue-50" },
  ];

  return (
    <SubjectPage
      title="Software Engineering Preparation"
      description="Understand SDLC, design principles, and best software practices."
      topics={topics}
    />
  );
};

export default SoftwareEngineering;
